column8:
★バランスを取りながら、脚、体を動かしてグングン進む人気の進化系スケートボード！<br>
<br>
●足でこぐ従来のスケートボードとは異なり、全身の動きやバランスで推進力を得ます。<br>
●360°滑らかに動くウィールと前後のデッキをつなぐバーがねじりを生み出し、自然とバランス感覚が身につく！<br>
●体重100kgまで対応。大人の方も安心してお使いいただけます。<br>
●日本語説明書とウィール調整用の六角レンチが付属。<br>
●運動不足の身体を楽しく動かせる、大人も子供もはまる新感覚スケートボード！親子や友達同士で楽しめます！<br>
<br>
※画像のカラーは、撮影時の照明等の具合により実物と異なる可能性がございます。<br>
なお、商品の色の見え方と実物の色は、お客様のご使用されているパソコン・モニターの環境等により多少異なる場合がございますのでご了承ください。
<BR>
<BR>
■サイズ<br>
本体：78×22cm<br>
ウィール：78×24mm<br><br>
